import type { FC } from "react";
import {ProfileOutlined,DesktopOutlined,LogoutOutlined,ExperimentOutlined,ProjectOutlined} from "@ant-design/icons"

const Profile: FC = () => {
  return <div className=" mt-5 m-auto w-[80%]">
    <div className="  gap-3 flex flex-1 flex-col mt-5 min-w-[310px] bg-[#F5F5F5] p-4 m-4 h-fit ">
     <div className=" "> <p className="hover:text-[#46A358] font-light cursor-pointer ">
      <ProfileOutlined />
        Ma'lumotlarim</p></div>
      <p className="hover:text-[#46A358] font-light cursor-pointer  "> <ExperimentOutlined />Tajribalarim</p>
      <p className="hover:text-[#46A358] font-light cursor-pointer "> <ProjectOutlined />Sertifikatlarim</p>
      <p className="hover:text-[#46A358] font-light cursor-pointer"> <DesktopOutlined />Qurilmalarim</p>
      <p className="hover:text-[#46A358] font-light cursor-pointer "> <LogoutOutlined />Chiqish</p>

    </div>
  </div>;
};

export default Profile;
